import React from 'react';
import { makeStyles} from '@material-ui/core/styles';
import {NavLink, withRouter} from 'react-router-dom';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import DoubleArrowRoundedIcon from '@material-ui/icons/DoubleArrowRounded';
import MenuOpenRoundedIcon from '@material-ui/icons/MenuOpenRounded';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Routes from '../Routes';
import { Box,Avatar } from '@material-ui/core';
import avatar from '../images/avatar.png';



const useStyles = makeStyles((theme) => ({
  link:{
    textDecoration: 'none',
    color:theme.palette.text.primary
  }, 
  sideBar:{
    width:220,
    height:'30rem',
    background: '#511',

  },
  useravatar:{
    display: block,
    margin:'0.5rem auto',
    width: theme.spacing(13),
    height: theme.spacing(13)

  },

  navbar:{
    position:'static',
    background: '#c31432',  /* fallback for old browsers */
    // eslint-disable-next-line
    background: '-webkit-linear-gradient(to bottom, #240b36, #c31432)',
    // eslint-disable-next-line
    background: 'linear-gradient(to bottom, #240b36, #c31432)' 
  },

}));

function Navigation(){

  const classes=useStyles();

  return(
    <>
    <Box classname={classes.sideBar} component='div'>
      <Avatar  classname={classes.useravatar} src={avatar} alt='User' />
      <Divider />
      <List>
        {Routes.map((element,key) => (
          <ListItem button key={key}>
            <ListItemIcon>{element.listicon}</ListItemIcon>
            <ListItemText>{element.sidebarName}</ListItemText>
          </ListItem>

        ))}
      </List>

    </Box>


    <Box component='nav'>
      <AppBar className={classes.navbar}>
        <Toolbar>
          <IconButton>
            <DoubleArrowRoundedIcon style={{color:'white'}} />
          </IconButton>
          <Typography variant='h5'>
            Portfolio
          </Typography>
        </Toolbar>
      </AppBar>
    </Box>



    </>

  )

}


export default Navigation
